import React from 'react';
import MapGL from 'react-map-gl';

class Map extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
        county: null,
        latitude: 45.42, 
        longitude: -75.69, 
        width: "100vw", 
        height: "100vh"
    };

  }

  componentDidMount() {
    this.setState({
        county: this.props.county
    })
  }


  getViewport() {
    return {
        latitude: 45.42, 
        longitude: -75.69, 
        width: "100vw",
        height: "100vh"
    }
  }

  render() {

    let mapbox_token = "pk.eyJ1Ijoic2hhbGludnMiLCJhIjoiY2s4ZnNtZHhlMDd0NzNrcGU4eHJnYXgyOCJ9.qv2ft9xqJ32Ovea3vDq3Yg";

    return (
      <MapGL {...this.getViewport()} mapboxApiAccessToken={mapbox_token}>

      </MapGL>
    );
  }

}







export default Map;
